import "./App.css";

import React, { Component } from "react";

class App extends Component {
  state = {
    crystals: [("name": "Rose Quartz")],
  };
  render() {
    return (
      <div className="App">
        <h1>hey sis!!</h1>
      </div>
    );
  }
}

export default App;
